// name, season, number, image.medium, summary


export default function AllEpisodes({name, season, number, image, summary, rating}) {
  return (
    <>
      <h1>{name}{season}{number}</h1>
      <img src={image.medium} alt={"Game of Thrones related"}/>
      <p>{rating}</p>
      <p>{summary}</p>
    </>
  );
}
